import { Route, Routes } from "react-router-dom";
import Navbar from "./Components/Navbar";
import VideoBg from "./Components/VideoBg";

function App() {
  return (
    <div className="App">
      <Navbar />

      <Routes>
        <Route path="/" element={<Home />} />
      </Routes>

      <h1>Hello Blog</h1>
      <VideoBg />
    </div>
  );
}

export default App;
